  return (
    <PageContainer>
      <MapContainer center={[39.1, -76.1]} zoom={10} scrollWheelZoom={true}>
        {/* <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        /> */}
        <div id="windy">
          <TileLayer
            url="https://tiles.windy.com/tiles/v9.0/darkmap/{z}/{x}/{y}.png?key=fieU8xwZgvQ6b9LAHm9ws6BMV2jU73Qt"
            attribution='&copy; <a href="https://www.windy.com/">Windy.com</a>'
          />
        </div>
      </MapContainer>
    </PageContainer>
  );
}

export default Solution;
